eval("const projectData = [{\n  name: \"DOMA\",\n  mainText: \"My most recent position was at the real estate technology company Doma. Our 8 person creative team handled all the design needs for the entire company. This included sales collateral, event booth design, social media posts, infographics, internal decks, and many other types of projects.\",\n  secondaryText: \"Heres a sample of some of the projects I designed while I was there.\",\n  images: [\"Doma1.jpg\", \"Doma2.jpg\", \"Doma3.jpg\", \"Doma4.jpg\"],\n  types: [\"BRAND DESIGN\", \"SOCIAL MEDIA\", \"ILLUSTRATION\"]\n}, {\n  name: \"ILLUSTRATION PROJECTS\",\n  mainText: \"When it comes to illustration, there is so much room for creativity and space to explore different styles. I have always loved this medium and have strived to incorporate it into my projects as much as possible.\",\n  secondaryText: \"Here are a few illustrations Ive done which include invitations, social media posts, and book covers.\",\n  images: [\"Illustration_1.jpg\", \"Illustration_2.jpg\", \"Illustration_3.jpg\", \"Illustration_4.jpg\"],\n  types: [\"ILLUSTRATION\", \"PRINT\"]\n}, {\n  name: \"ALOHA GARDNER\",\n  mainText: \"Aloha Gardner is a Kauai based tea brand that specializes in butterfly pea flower tea. When designing their branding, I aimed to capture the femininity and delicate nature of their product. I combined a neutral color palette with soft curved lines to speak to the essence of the brand.\",\n  secondaryText: \"I focused a great deal on the butterfly pea flower illustration. I wanted it to work well on its own too, so that it may be used as an identifying mark for the brand.\",\n  images: [\"AG1.jpg\", \"AG2.jpg\", \"AG3.jpg\", \"AG4.jpg\"],\n  types: [\"BRANDING\", \"PRINT\"]\n}, {\n  name: \"DUKE FOUNDATION\",\n  mainText: \"During my time at the Outrigger Duke Kahanamoku Foundation, we worked on a variety of projects which included print collateral for various events, social media, and email graphics. The largest project was the collateral for the Hawaii Waterman Hall of Fame Awards, a yearly ceremony that celebrates watermen and women who have excelled in their sports. With my team we designed the program, invitation, table tents, sponsor cards, poster, and brand identity. Our goal was to make the print classy, refined, and specific to Hawaii.\",\n  secondaryText: \"\",\n  images: [\"ODKF1.jpg\", \"ODKF2.jpg\", \"ODKF3.jpg\", \"ODKF4.jpg\"],\n  types: [\"PRINT\", \"ILLUSTRATION\"]\n}, {\n  name: \"ALOHA SHROOM CAFE\",\n  mainText: \"Aloha Shroom Cafe is a tea and coffee brand that utilizes superfoods in their special blends. The goal of this project was to make packaging for them that stood out on the shelves, and highlighted the organic and natural properties of their ingredients. When designing I chose to keep the lines and shapes rough and organic, and made a pattern that showed layers of soil, and spots found on mushrooms.\",\n  secondaryText: \"The branding is a simplistic typographic mark that uses a mushroom as the center of Aloha. For the color palette, I sampled the bright orange tones from cordyceps, one of their main ingredients.\",\n  images: [\"shroom1.jpg\", \"shroom2.jpg\", \"shroom3.jpg\", \"shroom4.jpg\"],\n  types: [\"BRANDING\", \"PACKAGING\"]\n}];\nmodule.exports = {\n  projectData\n};//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/projectData.js\n");

